                        "Desc": "最高に頼もしいぐるぐるコマちゃんと共に戦う！<br>「ぐるぐるコマちゃん」を召喚する。長押しで発動した場合、カチーナはぐるぐるコマちゃんを召喚し、その上に乗る。<br>発動後、カチーナは夜魂値を60獲得し、夜魂の加護状態に入る。<br><br><color style='color:#FFD780;'>夜魂の加護 · カチーナ</color><br>ぐるぐるコマちゃんは行動するたびに夜魂値を消費する。<br>夜魂値が尽きると、カチーナの夜魂の加護状態は終了する。<br><br><color style='color:#FFD780;'>ぐるぐるコマちゃん</color><br>は単独で存在でき、カチーナが乗った場合は操ることもできる。ぐるぐるコマちゃんが存在している間、カチーナの元素スキル「いけ、ぐるぐるコマちゃん！」はぐるぐるコマちゃんに乗り降りするためのものに変わる。<br> · ぐるぐるコマちゃんが独立して存在している間、一定時間ごとに地面を叩き、カチーナの防御力を基に夜魂性質の<color style='color:#FFE699;'>岩元素範囲ダメージ</color>を与える。<br> · カチーナは、ぐるぐるコマちゃんに乗っている間、素早く移動したり、登ったりすることができ、さらに通常攻撃時には地面を叩き、カチーナの防御力を基に夜魂性質の<color style='color:#FFE699;'>岩元素範囲ダメージ</color>を与えるようになる。<br><br>ぐるぐるコマちゃんは岩元素創造物と見なされ、カチーナの夜魂の加護状態が終了すると消える。カチーナ自身が召喚したぐるぐるコマちゃんは1つのみ存在可能。<br><br><i>「ぐるぐるコマちゃん」はコマに見えるけど、実は硬い岩も砕くドリルなんだよ。</i>",
